export class SignIn extends Component {


    constructor(props) {
        super(props);
        this.state = {
            user_email: "games",
            password: ""
        }
    }



    render() {


        return (
            <div className="wrapper fadeInDown">
                <div id="formContent">
                    <h2 className="active signh2" > Sign In </h2>

                    <div className="fadeIn first">
                        <i className="fa-solid fa-user fa-6x mb-2 mt-2"></i>
                    </div>

                    <form name="signiF" action="/" method="GET">
                        <div>
                            <input type="email" id="email" className="fadeIn second" name="user_email" placeholder="Email adress" value={values.user_email} onChange={handleChange} onBlur={handleBlur} />
                            <input type="password" id="password" className="fadeIn third" name="user_pass" placeholder="password" value={user_pass} onChange={handleChange} />
                            <input type="submit" className="fadeIn fourth" value="Log In" />
                        </div>
                    </form>

                    <div id="formFooter">
                        <Link className="underlineHover" to="/forget-password">Forgot Password?</Link>
                        <br />
                        <Link className="underlineHover" to="/rigister">Create an account ?</Link>
                    </div>
                </div>
            </div>
        )
    }


    handleChange = event => {

    }

    handleSubmit = event => {
        console.log("Submitting");
        console.log(this.state);
    }
}

export default SignIn
